import react, { useState } from 'react';

const WordsList = ({ wordsList }) => {
    return (
        <div>
            {wordsList.map(item => <div key={item.id}>영단어: {item.english}, 뜻: {item.korean}</div>)}
        </div>
    );
};

export default WordsList;
